import React from "react";
import { Button, Card, Icon } from "antd";
import { Link } from "react-router-dom";

const { Meta } = Card;

export default class BillingPage extends React.Component {
  render() {
    return (
      <div style={{ padding: "30px" }}>
        <Card
          style={{
            width: "40%",
            margin: "5% auto auto auto",
            backgroundColor: "#ECECEC"
          }}
        >
          <Meta
            avatar={
              <Icon
                type="check-circle"
                theme="twoTone"
                twoToneColor="#52c41a"
                style={{ marginRight: "50px", fontSize: "50px" }}
              />
            }
            title="Your order received successfully"
            description="We will collect the items from you"
          />
        </Card>
        <Link to={{ pathname: "/" }}>
          <Button
            type="secondary"
            size="large"
            style={{ margin: "3% 5% 0% 40%" }}
          >
            Go back to Home
          </Button>
        </Link>
      </div>
    );
  }
}
